export const Todos = ({ todos = [] }) => {
  return (
    <ol className="">
      {todos.map((todo) => (
        <TodoItem key={todo.id} todo={todo} />
      ))}
    </ol>
  );
};

const TodoItem = ({ todo }) => {
  return (
    <li className=" mt-3">
      <span className="p-2 border-2 border-r-2">{todo.title}</span>
    </li>
  );
};
